import React, { useState } from 'react';

import './App.css';

const App: React.FC = () => {

  const [name, setValue] = useState('abc')

  console.log(name)

  return (
    <div className="App">
      <input value={name}
        onChange={event => setValue(event.target.value)} />
      <p>{name}</p>
    </div>
  );
}

export default App;
